svg.script:
var objList = [
	{id: "Lind_1", from: 6, to: 99998},
	{id: "Lind_2", from: 7, to: 99998},
	{id: "Lind_3", from: 8, to: 99998},
	{id: "Lind_4", from: 9, to: 99998},
	{id: "rua_1", from: 21, to: 99998},
	{id: "g88474", from: 22, to: 99998},
	{id: "rua_2_2", from: 23, to: 99998},
	{id: "rua_3", from: 24, to: 99998},
	{id: "rua_4", from: 25, to: 99998},
	{id: "ethical_1", from: 33, to: 99998},
	{id: "netflix_1", from: 40, to: 99998},
	{id: "netflix_2", from: 41, to: 99998},
	{id: "netflix_3", from: 42, to: 99998},
];
    function onDisplayReady() {
        onFrameChange(sozi.location.getFrameIndex());
    }
    function onFrameChange(index) {
      for (var i = 0; i < objList.length; i++) {
        document.getElementById(objList[i].id).style.visibility =
          (objList[i].from <= index && objList[i].to >= index)
              ? "visible" : "hidden";
      }
    }
    sozi.events.listen("sozi.display.ready", onDisplayReady);
    sozi.events.listen("sozi.player.framechange", onFrameChange);
